const Navbar = (props) => {
  const test = async () => {
    const response = await fetch(
      `https://api.themoviedb.org/3/trending/all/week?api_key=c08925b0a10a9ed2a65bf9f938d20719&language=en-US`
    );
    const data = await response.json();
    console.log(data);
  };
  return;
};
export default Navbar;
